description:
Gone in Sixty Seconds (2000)  118 min  -  Action | Crime | Thriller

Car theft in Long Beach went down 47% when Randall &quot;Memphis&quot; Raines walked away from the life. He gets dragged back into it by assuming the job his brother Kip screwed up for stolen-car broker Raymond Calitri: steal 50 exotic cars and have them on a container ship by 8 AM Friday morning, and he got this news on a Monday. With Calitri threatening to kill him and Kip, and the police GRAB unit breathing down his neck, Memphis reassembles his old crew and attempts to pull off the logistically impossible.

Stars: Nicolas Cage, Angelina Jolie, Robert Duvall, Vinnie Jones, Timothy Olyphant


